textOriginal:
Maravilhada com a atitude dessa mulher!!!!
Essa sim, é cristã de verdade e segue princípios bíblicos:
- "maldito do homem que confia no homem";
- "não terás outros deuses diante de mim";
- não age como "um cego que se deixa guiar por outro cego".
Como muitos ditos cristãos que não conhecem ou desprezam a Bíblia para fazer o que lhes interessa, não importando o que,  seguindo demônios disfarçados de pastor ou presidente da república...
